import React from "react";

const Header = () => {
  return (
    <header>
      <h1 className="text-2xl font-bold">Pokedex</h1>
      <nav>
        <ul className="flex space-x-4">
          <li><a href="/">Home</a></li>
          <li><a href="/pokemons">Pokemons</a></li>
          <li><a href="/about">About</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
